  if ( (loc = malloc(sizeof(NspGtkHRuler)))== NULLGTKHRULER) return loc;
  /* initialize object */
  if ( init_gtkhruler(loc,nsp_type_gtkhruler) == FAIL) return NULLGTKHRULER;
  return loc;
