  if ( GetArgs(stack,rhs,opt,T,&nsp_type_gtkadjustment, &hadjustment) == FAIL) return RET_BUG;
  gtk_scrolled_window_set_hadjustment(GTK_SCROLLED_WINDOW(self->obj), GTK_ADJUSTMENT(hadjustment->obj));
