  NspObject *nsp_state_type = NULL, *nsp_area = NULL;
  GdkRectangle area_rect = { 0, 0, 0, 0 }, *area;

  if ( GetArgs(stack,rhs,opt,T,&nsp_type_gdkwindow, &window, &set_bg, &nsp_state_type, &nsp_area, &x, &y, &width, &height) == FAIL) return RET_BUG;
