NspGtkTable   *gtktable_object(NspObject *O)
{
  /** Follow pointer **/
  HOBJ_GET_OBJECT(O,NULL);
  /** Check type **/
  if ( check_cast (O,nsp_type_gtktable_id) ) return ((NspGtkTable *) O);
  else 
    Scierror("Error:	Argument should be a %s\n",type_get_name(nsp_type_gtktable));
  return NULL;
}

